class HistoricalDataProcessor:
    def derive_historical_fields(self, record: Dict) -> Dict:
        """Derive fields for historical FABS data."""
        if "original_date" in record:
            record["processed_date"] = datetime.datetime.now().isoformat()
        return record

    def include_frec_derivations(self, records: List[Dict]) -> List[Dict]:
        """Include FREC derivations in historical data."""
        for record in records:
            record["frec_derived"] = True
        return records

